mutation sitesUpdateSecondaryAzureVSocket ( $updateSecondaryAzureVSocketInput:UpdateSecondaryAzureVSocketInput! $accountId:ID! ) {
	sites ( accountId:$accountId ) {
		updateSecondaryAzureVSocket ( input:$updateSecondaryAzureVSocketInput  )  {
			secondaryAzureVSocketUpdateSecondaryAzureVSocketPayload: secondaryAzureVSocket {
				site  {
					id
					name
				}

				id 
				interfaceIp 
				floatingIp 
			}
		}

	}	
}
